import * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import ErrorScreen from "./app/error/error";
import PageScreen from "./app/layout/page";
import foData from './app/content/data.json';
import foMenu from './app/content/menu.json';

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Page"
        screenOptions={{
          headerStyle: {
            backgroundColor: "#ff8040"
          },
          headerTintColor: "#ffffff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      >
        <Stack.Screen name="Page" component={PageScreen} source={foMenu} />
        <Stack.Screen name="Error" component={ErrorScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
